import React from 'react';


const PostStamp = (props) => {
    return (
        <div className="postStampContainer">
            <img 
                src="/images/hero.jpg"
                className="postStamp"
                width="200rem"
                height="120rem"
            >
            </img>
        </div>


    );

}


export default PostStamp;
